fields.calculatedFormula:
IMAGE(
  IF(Not ISBLANK(Ti_le_san_luong_dat_trong_nam__c ),  
     IF ( Ti_le_san_luong_dat_trong_nam__c * 100 <= 50, '/sfc/servlet.shepherd/version/renditionDownload?rendition=ORIGINAL_Png&versionId=068fD000002Qlrl&operationContext=CHATTER&contentId=05TfD000003E9zN',
     IF ( AND ( Ti_le_san_luong_dat_trong_nam__c * 100 > 50,  Ti_le_san_luong_dat_trong_nam__c * 100 <= 75), '/sfc/servlet.shepherd/version/renditionDownload?rendition=ORIGINAL_Png&versionId=068fD000002QltN&operationContext=CHATTER&contentId=05TfD000003EA0z',
     IF ( AND ( Ti_le_san_luong_dat_trong_nam__c * 100 > 75,  Ti_le_san_luong_dat_trong_nam__c * 100 <= 100), '/sfc/servlet.shepherd/version/renditionDownload?rendition=ORIGINAL_Png&versionId=068fD000002Qluz&operationContext=CHATTER&contentId=05TfD000003EA2b',
     IF ( AND ( Ti_le_san_luong_dat_trong_nam__c * 100 > 100,  Ti_le_san_luong_dat_trong_nam__c * 100 <= 125), 
'/sfc/servlet.shepherd/version/renditionDownload?rendition=ORIGINAL_Png&versionId=068fD000002QltO&operationContext=CHATTER&contentId=05TfD000003DtWV',
'/sfc/servlet.shepherd/version/renditionDownload?rendition=ORIGINAL_Jpg&versionId=068fD000002OnZX&operationContext=CHATTER&contentId=05TfD000003BXNE'
)
)
)
), 
    IF ( AND (NOT ISBLANK( Muc_tieu_nam__c ), ISBLANK ( Total_Cont_in_Year__c )), '/sfc/servlet.shepherd/version/renditionDownload?rendition=ORIGINAL_Png&versionId=068fD000003AE9d&operationContext=CHATTER&contentId=05TfD000004D3A8',
'/sfc/servlet.shepherd/version/renditionDownload?rendition=ORIGINAL_Png&versionId=068fD000002Qlq9&operationContext=CHATTER&contentId=05TfD000003E9xl')
),
"", 40,40)

/* Performance Rate Year (Text) */

IF(
  NOT(ISBLANK(Ti_le_san_luong_dat_trong_nam__c)),

  /* When the yearly achievement ratio exists */
  IF(
    Ti_le_san_luong_dat_trong_nam__c * 100 <= 50,
    "≤ 50% mục tiêu năm",
    IF(
      Ti_le_san_luong_dat_trong_nam__c * 100 <= 75,
      "50–75% mục tiêu năm",
      IF(
        Ti_le_san_luong_dat_trong_nam__c * 100 <= 100,
        "75–100% mục tiêu năm",
        IF(
          Ti_le_san_luong_dat_trong_nam__c * 100 <= 125,
          "100–125% mục tiêu năm",
          "> 125% mục tiêu năm"
        )
      )
    )
  ),

  /* When the ratio is blank – keep the same fallback as the image formula */
  IF(
    AND( NOT(ISBLANK(Muc_tieu_nam__c)), ISBLANK(Total_Cont_in_Year__c) ),
    "Có mục tiêu năm nhưng chưa có số Cont trong năm",
    "Không có dữ liệu"
  )
)
